import React, { useState } from 'react';
import style from "../CSScomponents/CostumerData.css";
import { useLocation, useNavigate } from 'react-router-dom';
import CostumerDetails from './CostumerDetails';

export default function CostumerData(props) {
    
    const location = useLocation();
    const {costumerData} = location.state;
    console.log(costumerData);
    const costumers = props.costumers;

 return(
    
  <div>
    <button></button>
    <CostumerDetails costumers = {costumers}/>
    <button></button>
    <button></button>
  </div>
 )
}
